fetch("https://api.quotable.io/quotes?limit=5").then((t=>t.json())).then((t=>{const e=document.getElementById("quote-list");t.results.forEach((t=>{const o=document.createElement("li");o.textContent=`${t.author}: "${t.content}"`,e.appendChild(o)}))})).catch((t=>{console.error("Error loading quotes:",t),document.getElementById("quote-list").innerHTML='<li style="color:red;">Failed to load quotes</li>'}));